import React from 'react';
import DynamicFieldsForm from "../../../common/DynamicFieldsForm";
import {Button, Tabs,Divider,Table,Card , Icon ,Radio,Tag} from "antd";
import PrintSettings from "./PrintSettings";
const TabPane = Tabs.TabPane;
class Printout extends React.Component{
	constructor(props){
		super(props);
		const panes = [
	      { title: 'Prescription', content: <PrintSettings/>	, key: '1' },
	      { title: 'Treatment Plan', content: 'Content of Tab 2', key: '2' },
	      { title: 'Case Sheet', content: 'Content of Tab 2', key: '3' },
	      { title: 'Medical Leave', content: 'Content of Tab 2', key: '4' },
	      { title: 'Vital Signs', content: 'Content of Tab 2', key: '5' },
	      { title: 'Lab Order', content: 'Content of Tab 2', key: '6' },
	      {title: 'Lab Order Result', content: 'Content of Tab 3', key: '7', closable: false,},

	    ];

	    this.state = {
	      activeKey: panes[0].key,
	      panes,
	    };

	}


	render(){
		return (<div>
	            <Tabs defaultActiveKey="emr" size="small">
	              <TabPane tab={<span><Icon type="calculator" />EMR</span>} key="emr">
	              	<Card>
		              	<h4>
                        <div>
                        	<Tabs size="small">
                        		{this.state.panes.map(item=><TabPane tab={item.title} key={item.key}>{item.content}</TabPane>	)}
							 					  </Tabs>
                        </div>
	                    </h4>
	             		</Card>
	              </TabPane>
	              <TabPane tab={<span><Icon type="book" />BILLING</span>} key="billing">
		              <Card>
			               	<h4>
		                      <div>
		                          <Radio.Group defaultValue="a" buttonStyle="solid">
							        				<Radio.Button value="a">Invoices</Radio.Button>
							        				<Radio.Button value="b">Receipts</Radio.Button>
							    						</Radio.Group>
		                      </div>
		                    </h4>
		             	</Card>
	              </TabPane>
	            </Tabs>
		</div>);
	}

}
export default Printout;
